import '../styles/Home.css';
import React from 'react';
import pic from "./img/nuwc1.jpg";

function Home() {
  return (
    <div className='header'>
        <p><strong>Welcome to NavTask!</strong></p>
        <img src={pic} alt="Logo" />
    </div>

  );
}

export default Home;
